import React from 'react';
import styled from 'styled-components';

const NavBar = styled.nav`
    z-index: 50;
    display: flex;
    padding-top: 1rem;
    padding-left: 1rem;
    width: 100%;
    background-color: snow;
    button {
        color: black;
        background: transparent;
        border: none;
        width: 6vw;
        height: 5vh;
        padding-right: 3em;
        padding-left: 3em;
        font-size: 20px;
        font-weight: 900;
        width: max-content;

        cursor: pointer;
    }

    img {
        z-index: 2;
        width: 3vw;
    }
`;


export default function Nav() {
    return (
        <NavBar>
            <img src="testLogo.png" alt=""></img>

            <button>About Us</button>
            <button>Login</button>
            <button>Register</button>
        </NavBar>
    )
}
